import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import "./App.css";

const useStyles = makeStyles({
  login: {
    display: "grid",
    placeItems: "center",
    height: "100vh",
    backgroundColor: "black",

    "& img": {
      width: "50%",
    },

    "& a": {
      padding: "20px",
      borderRadius: "99px",
      backgroundColor: "#1db954",
      fontWeight: 600,
      color: "white",
      textDecoration: "none",
    },

    "& a:hover": {
      backgroundColor: " white",
      borderColor: "#1db954",
      color: "#1db954",
    },
  },
});

function Home() {
  return (
    <div className="App">
      <header className="classes.login">
        <p>You are not logged in to Spotify</p>
        <a className="App-link" href={"/auth/login"}>
          Login Here
        </a>
      </header>
    </div>
  );
}

export default Home;
